objet:
l'association a pour buts : 
-	de grouper les personnes s'intéressant à la Manufacture, Monument historique inscrit, à son histoire, à sa mise en valeur, à sa restauration, à la sauvegarde de son environnement, à l'enrichissement de ses collections et à sa promotion touristique ; 
-	de grouper les personnes s'intéressant plus généralement à la Tapisserie d'Aubusson ; 
-	de promouvoir le site et les sites complémentaires hors les murs, la Tapisserie, l'art tissé et le design, les actions développées autour du textile ; 
-	de contribuer à la fidélisation des publics de la Manufacture ;  
-	de développer des activités culturelles et sociales en accueillant des artistes, en organisant des expositions, stages, réunions, conférences, évènements artistiques etc
 ; 
-	de faire uvre d'historien d'art en recherchant tous les documents ayant trait à l'histoire de la Manufacture et plus généralement de la Tapisserie ; 
-	d'agir pour la sauvegarde, la mise en valeur, la promotion et le rayonnement de la Manufacture et du patrimoine culturel ancestral qu'elle représente ; 
-	d'acquérir des uvres artistiques, par des achats et dons ; 
l'association mettra en uvre toute activité, manifestation et publication lui permettant de réaliser cet objet ;

l'animation, la mise en place d'un lieu de partage social, culturel et festif ; l'organisation d'expositions, d'ateliers participatifs, de manifestations culturelles ; la protection de l'environnement et du patrimoine, la récupération, la remise en valeur et la diffusion de toutes objets usagés, l'activité de renouvellerie participative, solidaire et sociale ; 
l'activité de café et de petite restauration ; 
la projection d'oeuvre audiovisuelle ; 
la vitrine et la diffusion des arts et design d'Europe ; 
la mise en valeur des produits régionaux et des spécialités gastronomiques ;

recherche théorique et pratique autour des arts textiles ; 
organiser des événements culturels à ce sujet (projections, conférences, ateliers, ;  ;  ; ) 
soutenir (coordination, diffusion, financement
) des artistes dans la création d'uvre en lien avec l'objet de l'association ; 
et tout autres activités en lien avec l'objet de l'association ;

défendre l'environnement et les espaces naturels, le patrimoine bâti, la qualité des paysages ; 
Protéger la faune et la flore contre les atteintes qui pourraient leur être portées ; 
Défendre le cadre de vie , la propriété, la sécurité et la santé ; Lutter contre la pollution sonore ; 
Sensibiliser l'opinion public aux problèmes d'environnement ; 
Défendre l'identité culturelle des paysages et du patrimoine, ainsi que les intérêts naturels, économiques, historiques et sociaux ; 
Lutter, notamment par toute action en justice, contre les projets d'installation de parcs éoliens incompatibles avec les sites remarquables, paysages, monuments, équilibre biologiques, espèces animales et végétales, et avec la santé et la sécurité ; 
Défendre l'application des lois et règlementations territoriales en vigueur ; 
Favoriser le développement de projets utiles à la vie de l'homme et respectueux des sites naturels et répertoriés ;

l'association a pour but au delà des artistes plasticiens de réunir également des poètes, des musiciens, des chanteurs, des artistes de toutes disciplines, et ce dans le monde entier ; 
L'association organisera des expositions collectives et individuelles en France et a l'étranger, vendra des uvres,  vendra des produits dérivés sur tous supports, 
L'association interviendra dans le domaine artistique et ce dans les pays du monde entier et aidera tous les artistes ayant participé a la création  de la fresque ;

l'association a pour objet de défendre, et de concourir à la conservation du site du Parc Naturel Régional des Millevaches, en vue de la protection de l'environnement, la protection de la faune, de la flore et du biotope dans le site du Parc Naturel Régional des Millevaches, du bien-être de la population et la sauvegarde du cadre de vie, en agissant pour la sauvegarde de ses intérêts dans le domaine de l'aménagement, de l'urbanisme et de l'environnement, ainsi que d'agir et/ou de défendre en justice les intérêts de l'Association et ses membres ; 
elle exerce son action sur l'ensemble du territoire du Parc Naturel Régional des Millevaches en Limousin, situé à cheval sur les départements de la Corrèze (19) , la Creuse (23) et la Haute-Vienne (87) , depuis la Creuse (23) ; 
elle exerce également son action à l'égard de tout fait, et notamment de fait de pollution, qui bien que né en dehors de sa compétence géographique, notamment sur les communes limitrophes du Parc Régional Naturel, serait de nature à porter directement ou indirectement atteinte au Parc Naturel Régional des Millevaches, notamment sa faune, sa flore et l'équilibre de son biotope ;

créer, organiser des événements culturels et artistiques publics et privés, de sa propre initiative et en lien avec différents partenaires associatifs, publics et privés et de tout autre type ; 
uvrer pour la mise en valeur et l'utilisation des formes artistiques et culturelles de manière générale et plus spécifiquement des arts émergents, des arts de la rue, des arts visuels, des arts culinaires, acrobatiques, pyrotechniques, chorégraphiques, poétiques, théâtrales et des arts musicaux numériques et alternatifs ; 
Créer et de gérer un collectif ayant pour but de permettre la création et l'organisation d'événements aux styles artistiques plus variés et de plus grande ampleur ; 
Poursuivre des activités économiques ; 
Proposer ses compétences logistiques et artistiques en événementiel, notamment en lien avec différents partenaires ; 
Promouvoir l'emploi de toutes formes artistiques à toutes occasions ;

promouvoir les médecines douces et de donner accès à chacun aux médecines holistiques, naturelles et traditionnelles qui ont fait leurs preuves depuis des siècles ; 
Elle est destinée à toute personne désirant  découvrir personnellement ou dans le cadre de son travail une approche du mieux être basée sur d'autres formes thérapeutiques que la médecine conventionnelle comme par exemple, le magnétisme, le reiki, la lithothérapie, l'aromathérapie la méditation, la réflexologie plantaire, la sophrologie, la psychologie ou toutes autres pratiques  de bien-être naturel ; 
Toute personne pourra s'informer, se former par le biais de conférences, de stages, d'échanges au sein de l'association, recevoir des soins ; Lors de ces moments d'échange et de partage des personnes pourront  être hébergées ou accueilli à titre gracieux ou onéreux par l'association ; 
Pour se faire, l'association pourra utiliser tout moyen de communication et pourra organiser des manifestations payantes ; 
L'association, lors de toutes ses activités (par le conseil, la formation ou la pratique de soins etc
) ne se substituera pas au corps médical ou psychothérapeutique ; Elle pourra, en revanche, par ces diverses techniques, en être un précieux complément ;

contribuer - sur le territoire de la Creuse - à réduire les inégalités sociales, notamment en favorisant la mobilité et le retour à la mobilité des publics les plus défavorisés  en proposant aux adhérents de l'association un accompagnement et un encadrement dans leurs travaux de réparations mécaniques, ainsi qu'en mettant à leur disposition un outillage approprié ; 
Développer des actions événementielles, des ateliers pédagogiques, et des stages d'initiation à la mécanique, dans le respect des principes de l'éducation populaire,  ouverts à tous les publics, et en premier lieu aux résidents des quartiers prioritaires dans la zone de service de l'association ; 
Inciter les adhérents usagers de l'association à prendre part aux processus de réparation, favorisant ainsi la transmission et l'échange de savoirs et de compétences, et au delà, impliquer fortement les adhérents dans la vie de l'association, sa gestion, et ses processus décisionnels ; 
Développer par le biais des activités de l'association, un espace d'accueil, de diversité, de convivialité, de rencontres, et de partage, en renforçant le lien social, et en valorisant les acquis culturels et sociaux de chaque adhérent, dans le respects des principes fondateurs de la république, et de ses valeurs citoyennes et laïques

cette association a pour objet de faire naître une gouvernance politique innovante, ouverte sur le territoire communal et intercommunal, co-construite dans la transparence avec les citoyens et consciente des transformations de notre société ; Elle a pour vocation de faire émerger et de bâtir des projets d'action (s) , d'élaborer des propositions d'action, de les porter afin d'impulser une nouvelle politique municipale, mais aussi de promouvoir une nouvelle attitude politique ; 
L'association a vocation à rassembler tous ceux qui se reconnaissent dans les valeurs et idées de la République, laïques, sociales, progressistes, européennes, réformatrices et humanistes, en s'ouvrant à tous les citoyens qui veulent s'engager pour notre ville, son territoire et leur devenir ; 
L'association uvre à l'action collective dans l'intérêt de la ville et de son territoire de projets, dans le respect du paragraphe précédent ; À ce titre, les appartenances multiples à des mouvements concourant aux mêmes objectifs sont autorisées ; 
La position de l'association sur les politiques publiques menées n'est jamais déterminée par la couleur politique de ceux qui les promeuvent mais uniquement sur la base des mérites desdites politiques et de leur conformité à ses valeurs ;

accompagner des malades traversant une phase critique d'une maladie grave, ou en fin de vie, ainsi que celui de leurs proches ; 
Représenter ces personnes auprès des Institutions, et notamment les commissions d'usagers ; promouvoir la culture palliative auprès des professionnels de santé, des institutions et du grand public ; 
pour ce faire : former, encadrer et soutenir des équipes d'accompagnants bénévoles pour les mettre en place dans les établissements de santé, établissement sociaux et médicosociaux, ainsi qu'à domicile ; 
participer activement à la diffusion de la culture palliative ; 
faire connaître son action par tous moyens appropriés ; 
à cette fin elle pourra accomplir toutes opérations utiles ou nécessaires à la réalisation de son objet ou susceptibles d'en faciliter le développement, et notamment toute opération financière, mobilière ou immobilière ;

agir en France et à l'étranger, pour faire naître, tester et développer des dispositifs porteurs de sens et d'imaginaires rendant tangibles de nouvelles manières d'habiter le monde ; 
Elle agit (restauration et investissement de lieux historiques et de lieux en friche, exploration des solutions d'agriculture raisonnée, organisation de journées de plantation  ) réfléchit (organisation de débats et d'échanges inspirants, mise en place d'ateliers de création et de résidences
) , partage (conception et développement d'événements participatifs, organisation de séminaires, cours et stages, création et diffusion de publications
) et déploie toute action permettant de répondre à son objet ;

revatec a pour principal objet de développer un modèle économique et organisationnel d'écosystèmes territoriaux visant à rénover, recycler et distribuer des Aides Techniques pour l'Autonomie (ATA) ; 
Elle vise l'amélioration de l'accès aux ATA à l'attention des populations en situation de handicap et/ou en perte d'autonomie ; 
Elle attache une importance fondamentale à l'équité tant financière que géographique pour l'accès aux ATA et mettra tout en uvre pour faciliter la formation à leur usage ; 
L'écosystème territorial ainsi créé s'organise autour d'unités de rénovation dont les objectifs sont de : 
-Collecter ou faire collecter des Dispositifs Médicaux et Aides Techniques pour l'Autonomie auprès des particuliers, des établissements de santé et de tout organisme les ayant en sa possession ; 
-Hygiéniser, réparer et revaloriser ces matériels afin de pouvoir prolonger leur durée d'utilisation ; 
-Démanteler les matériels non-rénovés à des fins de constitution de stock de pièces détachées ; 
-Orienter vers des filières de valorisation les matières résiduelles pour favoriser un nouveau cycle d'exploitation ; 
-Distribuer les ATA y compris sous forme de temps d'usage (économie de la fonctionnalité) ; 
-Améliorer les conditions de travail des professionnels du domicile (prévenir la sinistralité) ; 
-Préserver la santé des aidants familiaux (éviter les épuisements prématurés) ; 
L'association a par ailleurs, vocation de créer des services innovants à l'attention des usagers, de créer des emplois locaux non délocalisables, d'accompagner des personnes dans un projet de vie privilégiant l'autonomie et de former à l'usage des matériels les publics en recherche d'autonomie ; 
A ce titre, elle relève de l'Economie Sociale et Solidaire et de l'Economie Circulaire de proximité nécessairement ancrées dans les territoires ; 
REVATEC se donne la possibilité d'utiliser tous moyens d'action pour parvenir à la réalisation de son objet et pourra participer à toute opération pouvant se rapporter à son objet par voie de création de sociétés ;
